import React from 'react';

function ImagePopup() {
  return (
    <div className="popup popup_type_zoom-image">
      <div className="popup__zoom-container">
        <img className="popup__zoom-image" src="#" alt="изображение карточки" />
        <p className="popup__zoom-title" />
        <button className="popup__close-button" aria-label="Закрыть" type="button" />
      </div>
    </div>
  );
}

export default ImagePopup;
